    "derive-debug",
    "derive-clone",
]
derive-debug = []
derive-clone = []
fallible = []
serde = [
    "dep:serde",
    "dep:serde_with",
    "json-number/serde",
    "url/serde",
]
doc = [
    "all-schema-sections",
]
